import React, { Component } from 'react';
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import Form from 'react-bootstrap/Form'
import FormControl from 'react-bootstrap/FormControl'
import Button from 'react-bootstrap/Button'
import ProductsPage from './ProductsPage';
import {Link} from 'react-router-dom';
import HomePage from './HomePage';
import Slider from './components/Slider'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';


class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  render() {
    return (
      <Router>
        <Navbar bg="light" expand="lg" >
        <Navbar.Brand href="#home"><img src={require('./images/logo.png')} style={{ width: '120px', height: '120px' }} /></Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
          <Route path='/slider' render={()=>{return <div><Slider></Slider></div>}} /> 
            <Nav.Link><Link to= '/slider'>
            Home</Link>
            </Nav.Link>
            {/* <Nav.Link><Link to='/slider'>Products</Link></Nav.Link> */}

            <Nav.Link><Link to= '/events'>Events</Link></Nav.Link>
            <Nav.Link><Link to= '/jewelry-care'>Jewelry Care</Link></Nav.Link>
            <Nav.Link><Link to= '/contact-us'>Contact US</Link></Nav.Link>

          </Nav>

          <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <Button variant="outline-success">Search</Button>
          </Form>
        </Navbar.Collapse>
      </Navbar>

      </Router>
    );
  }
}


export default Header;
